service.description:
&lt;p&gt;The CATAMI web site provides a location of the deposit and access of various underwater imagery, including data from Baited Remote Underwater Video (BRUV), Autonomous Underwater Vehicles (AUV), Diver Operated Video (DOV) and Towed Imagery (TI). Functionality and uses of this service include:&lt;/p&gt;
				&lt;ul style="list-style-type: circle;"&gt;
				&lt;li&gt;Methods for querying the image database based on criteria such as depth, position, time, image labels, etc. will allow relevant subsets of the data to be quickly extracted from the repository for further analysis;&lt;/li&gt;
				&lt;li&gt;Online access to geotiff images of the integrated terrain models that allow broad scale patterns to be examined and allows users to identify particular subsets of the data that are of interest.&lt;/li&gt;
				&lt;li&gt;Access to video data collected by BRUVS, UTV and ROV systems. &lt;/li&gt;
				&lt;li&gt;Presentation of summary statistics for dives and campaigns based on analysis output.  The ability to quickly examine the makeup of individual dives, including sample images of the relevant habitat types, will allow end users to quickly examine and understand the content of individual deployments.&lt;/li&gt;
				&lt;/ul&gt;

&lt;div&gt;This project includes development funded by the Australian National Data Service (ANDS, &lt;a href="http://ands.org.au"&gt;http://ands.org.au&lt;/a&gt;) and the National eResearch Collaboration Tools and Resources (NeCTAR, &lt;a href="http://nectar.org.au"&gt;http://nectar.org.au&lt;/a&gt;).&lt;/div&gt;
				&lt;div&gt; &lt;/div&gt;
				&lt;div&gt;ANDS is supported by the Australian Government through the National Collaborative Research Infrastructure Strategy Program and the Education Investment Fund (EIF) Super Science Initiative.&lt;/div&gt;
				&lt;div&gt; &lt;/div&gt;
				&lt;div&gt;NeCTAR is an Australian Government project conducted as part of the Super Science initiative and financed by the Education Investment Fund. The University of Melbourne has been appointed the lead agent by the Commonwealth of Australia, Department of Industry, Innovation, Science, Research and Tertiary Education.&lt;/div&gt;

&lt;p&gt;
					This service is a web-based database application which enables researchers to record the genealogies of approximately 15,000 Tasmanian born AIF WWI enlistees. It is a particular application of the software developed by the Founders and Survivors: Genealogical Connections project which will enable the Convicts and Diggers project to record and manage its research data.&lt;/p&gt;
				&lt;p&gt;
					Each Tasmanian born WWI enlistee (basic data for each enlistee is provided by the National Archives of Australia) will exist in this database as a person with a WWI enlistee event. These people form the base population of interest. The service will allow data related to each person&amp;#39;s birth, WWI service records, illnesses, death and any arbitrary events of interest to be accurately recorded as life course events (with date and place) and cross-referenced back to the supporting evidence. The service will support recording of each person&amp;#39;s genealogy ie. their immediate ancestry (mother and father) as relationships to other people, and so on for the parents, back through multiple generations (typically one to three), and potentially linking up to convict ancestors which have been extensively researched by the Founders and Survivors project. In some cases events and relationships can be loaded from other sources using automated processes. Otherwise the service provides a web-based interface for approved researchers to manually record events and relationships of interest.&lt;/p&gt;
				&lt;p&gt;
					The service will enable researchers to assign enlistees to various groups, forming cohorts, using arbitrary data or the presence of certain events. For example:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						enlistees who were rejected for service (possibly sub-grouped by the grounds for rejection);&lt;/li&gt;
					&lt;li&gt;
						enlistees who served at home;&lt;/li&gt;
					&lt;li&gt;
						enlistees who served abroad (possibly sub-grouped by battalian);&lt;/li&gt;
					&lt;li&gt;
						enlistees who enlisted at a place outside of their native Tasmania;&lt;/li&gt;
					&lt;li&gt;
						enlistees with convict ancestors (possibly sub-grouped by the convict ancestor&amp;#39;s convict ship of arrival to Van Diemen&amp;#39;s Land);&lt;/li&gt;
					&lt;li&gt;
						enlistees without convict ancestors;&lt;/li&gt;
					&lt;li&gt;
						enlistees with unknown ancestors;&lt;/li&gt;
					&lt;li&gt;
						enlistees who sufferred illness/injury of particular types during service at home or abroad;&lt;/li&gt;
					&lt;li&gt;
						enlistees who died in action;&lt;/li&gt;
					&lt;li&gt;
						enlistees who served abroad and who survived WWI;&lt;/li&gt;
					&lt;li&gt;
						enlistees who sufferred illness/injury of particular types after service;&lt;/li&gt;
					&lt;li&gt;
						enlistees whose death has been traced (sub-grouped by cause of death);&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
					For the whole population and/or known cohorts, the service will allow name and faceted data searching to locate individuals or smaller groups of interest.&lt;/p&gt;
				&lt;p&gt;
					The service will allow a range of report types and outputs to be generated from selected records. Outputs will include visualisations such as time-aware maps of aggregated life course events presented by Google Earth and genealogy diagrams. Other outputs will be narrative life course reports for each individual and exported data (and metadata) to support specific analysis such as demographic life expectancy.&lt;/p&gt;

&lt;p&gt;
					This service is a web-based database containing the genealogies of approximately 8,000 Kooris who lived in Victoria and New South Wales in the 19th and 20th Centuries.&lt;/p&gt;
				&lt;p&gt;
					This service is under development.&lt;/p&gt;
				&lt;p&gt;
					A prototype version 1 based on an earlier input collection is available.&lt;/p&gt;

&lt;p&gt;The SEQuITOR (&lt;strong&gt;S&lt;/strong&gt;outh &lt;strong&gt;E&lt;/strong&gt;ast &lt;strong&gt;Qu&lt;/strong&gt;eensland &lt;strong&gt;I&lt;/strong&gt;ntegrated &lt;strong&gt;T&lt;/strong&gt;errestrial to &lt;strong&gt;O&lt;/strong&gt;ceans &lt;strong&gt;R&lt;/strong&gt;esearch) harnesses investments and innovations in observation networks (e.g. TERN, IMOS, ANDS, State agency, CSIRO) and integrates catchment and receiving environment modelling to develop data delivery, assimilation and visualisation infrastructure that will allow researchers and managers to better understand the strong, but often highly episodic (e.g. floods) connection between activities in the catchment and the effects on downstream coastal and marine aquatic water quality and ecosystem health.&lt;/p&gt;
				&lt;p&gt;SEQuITOR tool &lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;will consist of three primary components:&lt;/span&gt;&lt;/p&gt;
				&lt;ul&gt;
				&lt;li&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;time series data services&lt;/span&gt;&lt;/li&gt;
				&lt;li&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;geospatial data and catalogue services&lt;/span&gt;&lt;/li&gt;
				&lt;li&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;visualisation portal&lt;/span&gt;&lt;/li&gt;
				&lt;/ul&gt;
				&lt;div&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;&lt;strong&gt;Time series data services&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;
				&lt;div&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;The time series data services will be handled by CSIRO's SensorCloud system. SensorCloud provides a server-side, configurable tool for ingesting data from a range of sources. These data sources will come from data providers on a routine basis. SensorCloud is able to consume data from a wide variety of sources inluding OGC services, databases, FTP locations and many others.&lt;/span&gt;&lt;/div&gt;
				&lt;div&gt; &lt;/div&gt;
				&lt;div&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;&lt;strong&gt;&lt;span id="cke_bm_101S" style="display: none;"&gt; &lt;/span&gt;Geospatial data &lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;and catalogue services&lt;/span&gt;&lt;/strong&gt;&lt;span id="cke_bm_101E" style="display: none;"&gt; &lt;/span&gt;&lt;/div&gt;
				&lt;div&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;The geospatial and catalogue service layer will utilise three primary tools - GeoServer, GeoNetwork and THREDDS data server. Data and metadata, where possible, will be harvested from data providers using these tools. For organisations which do not have the technical capabilities to host their own data in a public space, data will be hosted by the SEQuITOR project and appopriate update mechanisms put in place to ensure that data remains current.&lt;/span&gt;&lt;/div&gt;
				&lt;div&gt; &lt;/div&gt;
				&lt;div&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;&lt;strong&gt;Visualisation portal&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;
				&lt;div&gt;&lt;span style="font-family: Arial, Helvetica, sans-serif;"&gt;The SEQuITOR visualisation portal will be using the Australian Ocean Data Network (AODN) as the initial code base and the SEQITOR team will be working with the AODN development team to share developments.&lt;/span&gt;&lt;/div&gt;

&lt;p&gt;
					FedUni Spatial is an interoperable web-GIS. The impetus for the project was to provide the most relevant and current Natural Resource Management (NRM) data into an environment where it can be shared with and accessed by catchment managers, researchers, consultants, municipalities, government agencies and members of the general public.&lt;/p&gt;
				&lt;p&gt;
					FedUni Spatial was initially established as a collaborative project between the &lt;a href="http://www.ccma.vic.gov.au" target="_blank"&gt;Corangamite Catchment Management Authority&lt;/a&gt; (CMA) and the &lt;a href="http://www.federation.edu.au" target="_blank"&gt;Federation University Australia&lt;/a&gt; (UB).&lt;/p&gt;
