&lt;p&gt;The objective of this software is to enable hind-cast modelling of monthly Gross Primary Production (GPP) for the Australian continent- using a variety of input data sources.&lt;/p&gt;
				&lt;p&gt;The software consists of two main parts (refer Figure 1);&lt;/p&gt;
				&lt;p&gt;1.    A data abstraction layer, containing tools for formatting model inputs neccesary to model GPP.&lt;/p&gt;
				&lt;p&gt;2.    A model core containing tools for calibration and validation of the model against Australian flux tower observations and ultimately, gridded monthly hind-casts of GPP.&lt;/p&gt;
				&lt;p&gt;The software was designed “by the community for the community”, meaning it is intended to be used for generating new “simple models” using the authors own model as the benchmark. This purposely-inbuilt transparency makes it a sustainable platform for future generations of GPP models of this kind. As such, the software package has the following general features;&lt;/p&gt;
				&lt;p style="margin-left: 18.0pt;"&gt;a.     It is capable of reading and re-gridding a range of datasets from the Terrestrial Ecosystem Researcg Network, Australian Government Bureau of Meteorology and Geoscience Australia. This software layer is called- The Data Abstraction Layer (TDAL).&lt;/p&gt;
				&lt;p style="margin-left: 18.0pt;"&gt;b.     It features a modular design, making it usable as a stand-alone tool OR embedded inside another workflow OR ported to a completely novel model core.&lt;/p&gt;
				&lt;p style="margin-left: 18.0pt;"&gt;c.     It facilitates point-to-point calibration and validation against OzFlux tower data across a range of spatial and temporal scales.&lt;/p&gt;
				&lt;p style="margin-left: 18.0pt;"&gt;d.     It has been written in an open source language with the intention of ongoing, cross platform interoperability.&lt;/p&gt;
				&lt;p style="margin-left: 18.0pt;"&gt;&lt;img style="width: 470px; height: 353px;" src="http://1.bp.blogspot.com/-RHc9xktp1Cg/T82ZdiHjUGI/AAAAAAAAAEI/MXmBOub3RYQ/s1600/Slide1.png" alt="Visualisation of the softwares general workflow" /&gt;&lt;/p&gt;
				&lt;p&gt;The software has been written as an R-Project package. R is widely used for benchmarking within our user community, one example of this is &lt;a href="http://www.pals.unsw.edu.au/"&gt;PALS&lt;/a&gt;.  Data abstraction was implemented using the Geospatial Data Abstraction Library (&lt;a href="http://www.gdal.org/"&gt;GDAL&lt;/a&gt;), more specifically, &lt;a href="http://cran.r-project.org/web/packages/rgdal/index.html"&gt;RGDAL&lt;/a&gt; bindings and the &lt;a href="http://cran.r-project.org/web/packages/raster/"&gt;raster&lt;/a&gt; package are used for low-level reading and writing of data and to facilitate the high-level model functions required for the model and modelling system functionality.&lt;/p&gt;

