&lt;p&gt;Currently there is a general lack of engagement and knowledge transfer between professional researchers and end-users of research (general public, conservation managers, decision-makers, etc.). This is reflected in a general lack of acceptance and acknowledgement by the general public of the potential impacts of climate change. Indeed, the ABC reported 27 June 2011 that&lt;/p&gt;
				&lt;p&gt;"&lt;em&gt;The Lowy Institute's annual poll asked about 1,000 people for their opinions ... The poll shows that there has been a steep fall in the number of Australians who think climate change is a serious problem which needs addressing now.&lt;/em&gt;"&lt;/p&gt;
				&lt;p&gt;Research individuals or groups spend considerable time and effort to bring together species occurrence data, but substantial effort is still required and limitations exist with respect to a) the accuracy of the localities, removing only blatantly incorrect records outside known locality, or b) using painstaking manual processes whereby occurrence records are presented as hardcopy maps to “species experts.”  These experts then write metadata (e.g. provenance information), corrections, and other information about further records on the maps and return the comments for interpretation. This is a cumbersome, labour-intensive, and error-prone process which needs to be repeated for each project.&lt;/p&gt;
				&lt;p&gt;There is currently a scarcity of transparent online tools which integrate species distribution data, locality data with climate change scenarios in an integrated fashion which will facilitate the modelling of current and future species distributions based on climate scenarios.&lt;/p&gt;
				&lt;p&gt;The Edgar site provides a tool that reuses data available with &lt;a href="http://www.ala.org.au/"&gt;Atlas of Living Australia&lt;/a&gt; (ALA) and the Tropical Data Hub to allow a broad range of end-users to:&lt;/p&gt;
				&lt;ol&gt;
				&lt;li&gt;explore with the potential impacts of climate change on a wide range of species in Australia; and&lt;/li&gt;
				&lt;li&gt;engage in improving our understanding of the species and the modelling of species distributions.&lt;/li&gt;
				&lt;/ol&gt;
				&lt;h3&gt;Process&lt;/h3&gt;
				&lt;p&gt;The project produces two sets of data for each species. Users visiting the project website can browse visual representations of both datasets and download data from the site or from the Tropical Data Hub.&lt;/p&gt;
				&lt;p&gt;The first production of data is a "cleaned" collection of species occurrence records. This is comprised of observation records imported from ALA and filtered through:&lt;/p&gt;
				&lt;ul&gt;
				&lt;li&gt;invalid record removal based on ALA metadata&lt;/li&gt;
				&lt;li&gt;plausibility checking based on species ranges supplied by BirdLife Australia&lt;/li&gt;
				&lt;li&gt;crowd-sourced classification of occurrences&lt;/li&gt;
				&lt;li&gt;manual resolution of conflicting classifications&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;in order to select only those occurrences that represent genuine survival in the wild.&lt;/p&gt;
				&lt;p&gt;Website visitors that have accounts with the ALA can log in and contribute occurrence record classifications. Feedback obtained is forwarded to ALA along with information relating to the final classification of occurrence records.&lt;/p&gt;
				&lt;p&gt;The second production of data is a set of current and future climate suitability maps for each species. These use the cleaned occurrence records and &lt;a href="http://www.cs.princeton.edu/~schapire/maxent"&gt;the MaxEnt algorithm&lt;/a&gt; to calculate climatological sensitivities for the species, then use those sensitivities to map climate/species suitability across Australia.  Future climate data is projected using climate change scenarios described by the IPCC AR5 report and consolidated across a number of climate models, such that a climate suitability map is available for each intersection of a climate scenario and year modelled.&lt;/p&gt;
				&lt;p&gt;Both data sets are regenerated as new information is obtained and the updated data is immediately available. Dataset descriptions in metadata stores are periodically updated to reflect the latest information.&lt;/p&gt;

&lt;p&gt;The software consists of &lt;/p&gt;
				&lt;ul&gt;
				&lt;li&gt;a CakePHP application to provide the web interface&lt;/li&gt;
				&lt;li&gt;collection of python scripts for downloading occurrence records from ALA services&lt;/li&gt;
				&lt;li&gt;collection of python scripts for running the modelling software&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;The system requires MapServer, PHP with MapScript module installed, PostgreSQL with PostGIS installed, and a web server.&lt;/p&gt;

&lt;p&gt;
					Currently there is a general lack of engagement and knowledge transfer between professional researchers and end-users of research (general public, conservation managers, decision-makers, etc.). This is reflected in a general lack of acceptance and acknowledgement by the public and stakeholders of the potential impacts of climate change, particularly on biodiversity.&lt;/p&gt;
				&lt;p&gt;
					Recently, researchers have begun to endeavour to make the results of their research public, however there are currently very few channels through which to communicate projected impacts on biodiversity.&lt;/p&gt;
				&lt;p&gt;
					The CliMAS Biodiversity site provides a tool that reuses data available with Atlas of Living Australia (ALA) and the Tropical Data Hub to allow a broad range of end-users to explore the potential impacts of climate change on biodiversity of terrestrial vertebrate species in Australia.&lt;/p&gt;
				&lt;strong&gt;Process&lt;/strong&gt;
				&lt;p&gt;
					The project produces both current and future species richness maps for to the level of genus, family and class for each of birds, mammals, reptiles, and amphibians. Users visiting the project website can browse maps of biodiversity and download data from the site or from the Tropical Data Hub. A second tool allows users to generate their own species richness maps to view overlaps between taxa.&lt;/p&gt;
				&lt;p&gt;
					The data is built from a set of current and future climate suitability maps for each species, generated for the CliMAS Biodiversity site. These use the occurrence records cleaned by experts and the MaxEnt algorithm to calculate climatological sensitivities for the species, then use those sensitivities to map climate/species suitability across Australia. Future climate data is projected using climate change scenarios described by the IPCC AR5 report and consolidated across a number of climate models, such that a climate suitability map is available for each intersection of a climate scenario and year modelled.&lt;/p&gt;
				&lt;p&gt;
					All species distribution models within a genus, family, or class are summed to generate maps that display the gradient of species richness within that taxa.&lt;/p&gt;
				&lt;p&gt;
					The datasets represent species distributions based on occurrence records from ALA prior to November 2012.&lt;/p&gt;

