&lt;p&gt;
					GPlates is an open-source desktop software for the interactive visualisation of plate-tectonics.&lt;/p&gt;
				&lt;p&gt;
					GPlates combines interactive plate-tectonic reconstructions, geographic information system (GIS) functionality and raster data visualisation. GPlates enables the visualisation and manipulation of plate-tectonic reconstructions and associated data through geological time.&lt;/p&gt;
				&lt;p&gt;
					GPlates is developed by an international team of scientists and professional software developers at:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						the &lt;a href="http://www.earthbyte.org/" title="EarthByte Group - School of Geosciences"&gt;EarthByte Project&lt;/a&gt; (part of &lt;a href="auscope.html"&gt;AuScope&lt;/a&gt;) in the School of Geosciences at the University of Sydney (under the direction of Dietmar M&amp;uuml;ller)&lt;/li&gt;
					&lt;li&gt;
						the &lt;a href="http://www.gps.caltech.edu/" title="Caltech: Geological and Planetary Sciences"&gt;Division of Geological and Planetary Sciences&lt;/a&gt; (GPS) at CalTech (under the direction of Michael Gurnis)&lt;/li&gt;
					&lt;li&gt;
						the Center for Geodynamics at the &lt;a href="http://www.ngu.no/"&gt;Norwegian Geological Survey&lt;/a&gt; (NGU) (under the direction of Trond Torsvik).&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
					GPlates runs on Windows, Linux and MacOS X operating systems, and includes an online user manual. GPlates is free (open-source) software, licensed for distribution under the &lt;a href="http://www.gnu.org/licenses/old-licenses/gpl-2.0.html"&gt;GNU General Public License (GPL), version 2&lt;/a&gt;.&lt;/p&gt;
				&lt;p&gt;
					For further information refer to the official GPlates website: &lt;a href="http://www.gplates.org/"&gt;www.gplates.org&lt;/a&gt;&lt;/p&gt;

