&lt;p&gt;
					XGLOM is a tool for automated / semi-automated identification and quantification of glomeruli in kidneys that have been imaged using three imaging modalities:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						MR (Magnetic Resonance Imaging);&lt;/li&gt;
					&lt;li&gt;
