					&lt;li&gt;
						CT (X-ray computed tomography).&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
					XGLOM is intended to be used on:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						MR data collected from an Agilent 9.4T (Tesla) scanner based at the Monash Biomedical Imaging Facility (MBI);&lt;/li&gt;
					&lt;li&gt;
						Virtual histology images collected from an Aperio virtual microscope (slide scanner) based at the Monash histology Platform; and&lt;/li&gt;
					&lt;li&gt;
						CT data collected from the Imaging and Medical Beamline at the Australian Synchrotron (AS IMBL).&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
