&amp;lt;p&amp;gt;The Genomics Virtual Laboratory (GVL) is &amp;lt;a href=&amp;quot;https://www.nectar.org.au/&amp;quot;&amp;gt;NeCTAR &amp;lt;/a&amp;gt;funded infrastructure that will provide an opportunity for research institutes across Australia to participate in a community of accessible infrastructure, expertise and advocacy that connects genome researchers with massive datasets, sophisticated analysis tools, and large-scale computational infrastructure so that they can produce high-value globally competitive research results.&amp;lt;/p&amp;gt;
				&amp;lt;p&amp;gt;The GVL is broadly targeted at the “sequence-oriented” genome-related molecular bio-sciences – including epigenomics, transcriptomics, and meta- and eco-genomics.&amp;lt;/p&amp;gt;
				&amp;lt;p&amp;gt;The GVL will provide researchers with access to national-scale projects including the NeCTAR Research Cloud, RDSI, NCI, Bioplatforms Australia (BPA), Australian National Data Service, and the EMBL Australia mirror of EMBL-EBI. The GVL will be developed and operated by the Genome Informatics Network (GIN) the organisational umbrella within the newly formed Australian Bioinformatics Network endorsed by CSIRO, BPA and EMBL Australia. Members include the Universities of Queensland, Melbourne, Sydney, Western Australia and Monash University; CSIRO, and other universities and research institutes, representing thousands of researchers.&amp;lt;/p&amp;gt;
				&amp;lt;p&amp;gt;The primary aims will be to:&amp;lt;/p&amp;gt;
				&amp;lt;ul&amp;gt;
				&amp;lt;li&amp;gt;make tools, workflows, data, and experiments more accessible, shareable, reproducible and reliable;&amp;lt;/li&amp;gt;
				&amp;lt;li&amp;gt;improve data provenance; facilitate access to HPC resources; provide infrastructure tailored to the data-intensive demands of genomics;&amp;lt;/li&amp;gt;
				&amp;lt;li&amp;gt;provide a forum to collaborate and share data and workflows;&amp;lt;/li&amp;gt;
				&amp;lt;li&amp;gt;provide resources that advanced research groups can control and customise in the national research cloud;&amp;lt;/li&amp;gt;
				&amp;lt;li&amp;gt;promote the use of genome informatics through end-user support, training courses and outreach programs;&amp;lt;/li&amp;gt;
				&amp;lt;li&amp;gt;build informatics platforms on national infrastructure in a way that can be extended to other -omics and biosciences in the future.&amp;lt;/li&amp;gt;
				&amp;lt;/ul&amp;gt;

