&lt;p&gt;
					&lt;a href="http://www.climddir.org"&gt;The Climate Model Downscaling Data for Impacts Research (CliMDDIR) service&lt;/a&gt; makes output from Regional Climate Model (RCM) simulations of the recent and future climate of Australian regions available to climate change impacts researchers in data formats that they can read. The service&#39;s software reads netcdf binary files produced by RCM projects and exports impacts-relevant data in various ASCII formats, including those required by software tools used by the impacts community. Users are able to select their locations of interest within Australia and specify the climate variables that are of interest to them.&lt;/p&gt;
				&lt;p style="margin: 0px; padding: 5px 0px; color: rgb(51, 51, 51); font-family: Arial,Helvetica,sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(255, 255, 255);"&gt;
					The service currently allows users to access data from a single ~10km resolution simulation of the climate of southeast Australia performed using the WRF RCM. However, the service will eventually allow users to access data from an ensemble of WRF RCM simulations performed by the &lt;a href="http://www.ccrc.unsw.edu.au/NARCliM/"&gt;New South Wales and Australian Capital Territory Regional Climate Model (NARCliM) project&lt;/a&gt;. The aim of this project is to develop new, high (~10km) resolution climate projections for New South Wales and the Australian Capital Territory that will provide critical information to manage the impacts of climate change on health, settlements, agriculture, weather extremes and services, such as water and energy supplies. However, the NARCliM project also produces output for the whole of Australia at a resolution of ~50km.&lt;/p&gt;
				&lt;p&gt;
					&nbsp;&lt;/p&gt;
				&lt;p&gt;
					&nbsp;&lt;/p&gt;
				&lt;p&gt;
					&nbsp;&lt;/p&gt;

This workflow aligns paired-end next generation sequence data from one human sample to a reference genome using BWA. QC is performed prior to the alignment. &#13;
				&#13;
				After loading the two fastq input files of paired-end reads, FastQC (http://www.bioinformatics.bbsrc.ac.uk/projects/fastqc/), is run over them both. This produces two html reports, which are used to assess the sequence quality, and detect any overall quality problems. &#13;
				&#13;
				BWA (Burrows-Wheeler Alignment Tool - http://bio-bwa.sourceforge.net/) is used to align the reads against the reference genome. While the FastQC reports are being generated, the ‘bwa aln’ function is used to produce two ‘.sai’ formatted files (a format used within bwa). The paired-end alignment is then performed with the ‘bwa sampe’ function to produces a sam alignment file. The sam alignment file is converted to its equivalent compressed binary bam file via the samtools package (http://samtools.sourceforge.net/), suitable for further analysis.

This workflow counts the numbers of reads that align on or within 200bp of human exons of one run of exome capture paired-end sequencing data.&#13;
				&#13;
				After loading the two fastq input files, FastQC (http://www.bioinformatics.bbsrc.ac.uk/projects/fastqc/), is run over them both. This produces two html reports, which are used to assess the sequence quality, and detect any overall quality problems. &#13;
				&#13;
				BWA (Burrows-Wheeler Alignment Tool - http://bio-bwa.sourceforge.net/) is used to align the reads against the human hg19 reference genome. While the FastQC reports are being generated, the ‘bwa aln’ function is used to produce two ‘.sai’ formatted files (a format used within bwa). The paired-end alignment is then performed with the ‘bwa sampe’ function to produces a sam alignment file. The sam alignment file is converted to its equivalent compressed binary bam file, sorted and indexed via the samtools package (http://samtools.sourceforge.net/). The idxstats tool (also from samtools) is then run to obtain total counts of aligned and unaligned reads (output file total_aligned_counts.txt)&#13;
				&#13;
				The ‘windowBed’ utility from the BEDtools package (http://code.google.com/p/bedtools/) is run to filter the alignment to just those reads that overlap exons from the uploaded exon bed file. The filtered alignment is then sorted, and indexed like the full alignment, and the summary of reads overlapping exons is again produced using ‘idxstats’ (output file exon_aligned_counts.txt). Finally the process is repeated, but this time configuring ‘windowbed’ to also include reads that are within 200bp of exons (output file exon_200_flank_aligned_counts.txt).&#13;
				The three files of counts; aligned, exon aligned, and near exon aligned are then moved into into a single directory. These results files could be analysed to calculate the percentage of reads that align on or near exonic regions.&#13;
				&#13;

&lt;p&gt;
				    Currently there is a general lack of engagement and knowledge transfer between professional researchers and end-users of research (general public, conservation managers, decision-makers, etc.). This is reflected in a general lack of acceptance and acknowledgement by the general public of the potential impacts of climate change. Indeed, the ABC reported 27 June 2011 that&lt;/p&gt;
				&lt;p&gt;
				    &amp;quot;&lt;i&gt;The Lowy Institute&amp;#39;s annual poll asked about 1,000 people for their opinions ... The poll shows that there has been a steep fall in the number of Australians who think climate change is a serious problem which needs addressing now.&lt;/i&gt;&amp;quot;&lt;/p&gt;
				&lt;p&gt;
				    Research individuals or groups spend considerable time and effort to bring together species occurrence data, but substantial effort is still required and limitations exist with respect to a) the accuracy of the localities, removing only blatantly incorrect records outside known locality, or b) using painstaking manual processes whereby occurrence records are presented as hardcopy maps to &amp;ldquo;species experts.&amp;rdquo;&amp;nbsp; These experts then write metadata (e.g. provenance information), corrections, and other information about further records on the maps and return the comments for interpretation. This is a cumbersome, labour-intensive, and error-prone process which needs to be repeated for each project.&lt;/p&gt;
				&lt;p&gt;
				    There is currently a scarcity of transparent online tools which integrate species distribution data, locality data with climate change scenarios in an integrated fashion which will facilitate the modelling of current and future species distributions based on climate scenarios.&lt;/p&gt;
				&lt;p&gt;
				    The Edgar site provides a tool that reuses data available with &lt;a href="http://www.ala.org.au/"&gt;Atlas of Living Australia&lt;/a&gt; (ALA) and the Tropical Data Hub to allow a broad range of end-users to:&lt;/p&gt;
				&lt;ol&gt;
				    &lt;li&gt;
				        explore with the potential impacts of climate change on a wide range of species in Australia; and&lt;/li&gt;
				    &lt;li&gt;
				        engage in improving our understanding of the species and the modelling of species distributions.&lt;/li&gt;
				&lt;/ol&gt;
				&lt;h3&gt;
				    Process&lt;/h3&gt;
				&lt;p&gt;
				    The project produces two sets of data for each species. Users visiting the project website can browse visual representations of both datasets and download data from the site or from the Tropical Data Hub.&lt;/p&gt;
				&lt;p&gt;
				    The first production of data is a &amp;quot;cleaned&amp;quot; collection of species occurrence records. This is comprised of observation records imported from ALA and filtered through:&lt;/p&gt;
				&lt;ul&gt;
				    &lt;li&gt;
				        invalid record removal based on ALA metadata&lt;/li&gt;
				    &lt;li&gt;
				        plausibility checking based on species ranges supplied by BirdLife Australia&lt;/li&gt;
				    &lt;li&gt;
				        crowd-sourced classification of occurrences&lt;/li&gt;
				    &lt;li&gt;
				        manual resolution of conflicting classifications&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
				    in order to select only those occurrences that represent genuine survival in the wild.&lt;/p&gt;
				&lt;p&gt;
				    Website visitors that have accounts with the ALA can log in and contribute occurrence record classifications. Feedback obtained is forwarded to ALA along with information relating to the final classification of occurrence records.&lt;/p&gt;
				&lt;p&gt;
				    The second production of data is a set of current and future climate suitability maps for each species. These use the cleaned occurrence records and &lt;a href="http://www.cs.princeton.edu/~schapire/maxent"&gt;the MaxEnt algorithm&lt;/a&gt; to calculate climatological sensitivities for the species, then use those sensitivities to map climate/species suitability across Australia. &amp;nbsp;Future climate data is projected using climate change scenarios described by the IPCC AR5 report and consolidated across a number of climate models, such that a climate suitability map is available for each intersection of a climate scenario and year modelled.&lt;/p&gt;
				&lt;p&gt;
				    Both data sets are regenerated as new information is obtained and the updated data is immediately available. Dataset descriptions in metadata stores are periodically updated to reflect the latest information.&lt;/p&gt;

The software consists of&amp;nbsp;&lt;/p&gt;
				&lt;ul&gt;
				    &lt;li&gt;
				        a CakePHP application to provide the web interface&lt;/li&gt;
				    &lt;li&gt;
				        collection of python scripts for downloading occurrence records from ALA services&lt;/li&gt;
				    &lt;li&gt;
				        collection of python scripts for running the modelling software&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
				    The system requires MapServer, PHP with MapScript module installed, PostgreSQL with PostGIS installed, and a web server.&lt;/p&gt;
